body {
  height: auto;
  width: 100%;
}

.list-items {
  display: flex;
  justify-content: space-between;
}

.collapsible .content-parent {
  height: 0px;
  overflow: hidden;
  transition: height ease 0.3s;
  display: flex;;
}

.collapsible .content-parent.show{
  height:20r;
  width: 100%;
  margin: 0%;
}

.map {
  height: 100%;
  width: 50%;
